import React from "react";
import {Nav,NavbarContainer,NavLogo,MobileIcon,NavMenu,Navitem } from './NavbarElements'
const Navbar = () =>{
    return (
    <>
    <Nav>
    <NavbarContainer>
        <NavLogo to ='/'>TheOs</NavLogo>
        <MobileIcon>
            <Fabars>
            </Fabars>
        </MobileIcon>
        <Navmenu>
            <NavItem>
            <Navlinks to="about">About</Navlinks>
            </NavItem>
        </Navmenu>
    </NavbarContainer>
    </Nav>
    </>
    );
};

export default Navbar;
